import React, { Component } from "react";

import "../css/Sidebar.css";

class Sidebar extends Component {
  state = {};
  render() {
    return (
      <div class="sidenav">
        <a>About</a>
        <a>Services</a>
        <a>Clients</a>
        <a>Contact</a>
      </div>
    );
  }
}

export default Sidebar;
